function Ëé∑ÂèñÈ™åËØÅÁ†Å(url,ua){ // È™åËØÅÁ†ÅÈìæÊé•
    ua = ua||PC_UA;
    let ocr_api = 'http://ocr.nokia.press/dz6/api/ocr';
    let host = url.match(/(.*)\/\/(.*?)\//)[0];
    let headers = {
        'User-Agent': ua,
        'Referer':host,
        'Cookie':getMyVar('cookie'),
    };
    let hex=fetch(url,{headers:headers,toHex:true,timeout:3000});
    // log('hex:'+hex);
    let ret = request(ocr_api, {
        headers: {
            // 'content-type': 'application/json',
            'content-type': 'application/x-www-form-urlencoded',
        },
        // body: JSON.stringify(data),
        body: 'hex='+hex,
        method: 'POST'
    });
    try {
        ret = JSON.parse(ret).ret
    }catch (e) {}
    return ret
}

function Êèê‰∫§È™åËØÅÁ†Å(url,ua,method,body){
    ua = ua||PC_UA;
    method = method||'POST';
    body = body||'';
    let host = url.match(/(.*)\/\/(.*?)\//)[0];
    let headers = {
        'User-Agent': ua,
        'Referer':host,
        'Cookie':getMyVar('cookie'),
    };
    let params = {
        headers: headers,
        method: method,
        withHeaders:true
    };
    if(body){
        params.body = body
    }
    let cookie = JSON.parse(fetch(url, params));
    // log('È™åËØÅÂêéhtml:'+cookie.body);
    return cookie.body
}
